function numero(){
    //fazer para dizer se é inpar oouo par com if,se quiser depois eu faço com switch
    var n1
    n1=Math.floor(Math.random()*100) 
    document.getElementById("so").innerHTML=n1
    if (n1%2==0) {
        document.getElementById("so").innerHTML+=",<br> <b>Esse número é par<b>"
    }else{
        document.getElementById("so").innerHTML+=",<br> <b>Esse número é impar<b>"
    }
}
